import React from "react";
import { pages } from "../constant/pages";

const Sidebar = () => {
  return (
    <section className="z-10 relative rounded-l bg-cyan-900 h-[400px] w-[100px]">
      <nav>
        <ul>
          {pages.map((item) => {
            return (
              <li>
                <div className=" h-[50%] w-[100%]">{item.route} </div>
              </li>
            );
          })}
        </ul>
      </nav>
    </section>
  );
};

export default Sidebar;
